import styled from "styled-components";

export const Card = styled.article`
    width: 310px;
    padding: 30px;
    margin: 0;

    font-size: 14px;
    font-style: normal;
    font-weight: 400;
    line-height: 24px; /* 171.429% */

    background: #FDFDFF;
    box-shadow: 0px 4px 30px 0px rgba(22, 49, 82, 0.12);

    display: flex;
    flex-direction: column;
`;
